import React, { useEffect } from 'react';
import axios from 'axios';

export default function AttendanceTable() {
    useEffect(() => {
        const std_id = "221851"; // Replace with the actual std_id of the student
        const fetchData = async () => {
            let config = {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `JWT ${localStorage.getItem('access')}`,
                    'Accept': 'application/json'
                }
            };

            try {
                const response = await axios.get(`http://127.0.0.1:8000/api/marks/${std_id}/`, config);
                console.log("Response Data: ", response.data);
            } catch (error) {
                console.log("Error getting Marks:", error);
            }
        };

        fetchData();
    }, []); 

    return (
        <>
            {/* Your JSX for the attendance table */}
        </>
    );
}
